// src/pages/Admin/EditarAdmin.jsx
import React, { useState, useEffect } from 'react';
import { useNavigate, useParams, Link } from 'react-router-dom';
import api from '../../services/api';

export default function EditarAdmin() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [form, setForm] = useState({ nome: '', email: '', senha: '', nivelAcesso: '' });
  const [errors, setErrors] = useState({});

  useEffect(() => {
    async function fetchAdmin() {
      try {
        const res = await api.get(`/admins/${id}`);
        const { nome, email, nivelAcesso } = res.data;
        setForm({ nome, email, senha: '', nivelAcesso });
      } catch {
        navigate('/admins');
      }
    }
    fetchAdmin();
  }, [id, navigate]);

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      await api.put(`/admins/${id}`, form);
      navigate('/admins');
    } catch ({ response }) {
      setErrors(response.data.errors || {});
    }
  };

  return (
    <div className="container mt-4">
      <div className="card">
        <div className="card-header bg-white border-0 d-flex justify-content-between align-items-center">
          <h3 className="mb-0">Editar Admin</h3>
          <div>
            <Link to="/admins" className="btn btn-secondary me-2">← Voltar ao Início</Link>
            <Link to="/admins" className="btn btn-dark">Ver Admins</Link>
          </div>
        </div>
        <div className="card-body">
          <form onSubmit={handleSubmit}>
            <div className="mb-3">
              <label className="form-label">Nome</label>
              <input
                type="text"
                name="nome"
                className={`form-control ${errors.nome ? 'is-invalid' : ''}`}
                value={form.nome}
                onChange={handleChange}
              />
              {errors.nome && <div className="invalid-feedback">{errors.nome.msg}</div>}
            </div>

            <div className="mb-3">
              <label className="form-label">Email</label>
              <input
                type="email"
                name="email"
                className={`form-control ${errors.email ? 'is-invalid' : ''}`}
                value={form.email}
                onChange={handleChange}
              />
              {errors.email && <div className="invalid-feedback">{errors.email.msg}</div>}
            </div>

            <div className="mb-3">
              <label className="form-label">Senha</label>
              <input
                type="password"
                name="senha"
                className={`form-control ${errors.senha ? 'is-invalid' : ''}`}
                value={form.senha}
                onChange={handleChange}
              />
              {errors.senha && <div className="invalid-feedback">{errors.senha.msg}</div>}
            </div>

            <div className="mb-3">
              <label className="form-label">Nível de Acesso</label>
              <select
                name="nivelAcesso"
                className={`form-select ${errors.nivelAcesso ? 'is-invalid' : ''}`}
                value={form.nivelAcesso}
                onChange={handleChange}
              >
                <option value="">Selecione...</option>
                <option value="admin">Admin</option>
                <option value="super">Super</option>
                <option value="colaborador">Colaborador</option>
              </select>
              {errors.nivelAcesso && <div className="invalid-feedback">{errors.nivelAcesso.msg}</div>}
            </div>

            <button type="submit" className="btn btn-primary">Salvar Alterações</button>
          </form>
        </div>
      </div>
    </div>
  );
}
